  numberText(
    "Dodatkowe wymagania takie jak w szczególności konieczność wymiany lub remontu miejsca instalacji (np. połaci dachowej), dokonania wykopów, palowania, zainstalowania okablowania o długości powyżej 100 metrów oraz wykonania instalacji na budynku z użyciem podnośnika(np. zwyżki, wysięgnika koszowego, itp.) lub rusztowania traktowane są jako prace dodatkowe i nie są objęte w wynagrodzeniu Wykonawcy określonym w § 2 Umowy. Wykonawca przedstawi Zamawiającemu wycenę tych prac. W przypadku braku akceptacji wyceny. Zamawiający jest uprawniony do zlecenia wykonania powyższych prac we własnym zakresie. Wykonane prace podlegają ocenie spełnienia wymogów przez Wykonawcę, który wstrzyma się ze wznowieniem wykonywania przedmiotu Umowy do chwili ich zrealizowania."
  );
  numberText(
    "Zamawiający nie ma prawa zrealizować samodzielnie lub zlecić innemu podmiotowi (tzw.wykonawca zastępczy) prac dotyczących ewentualnie zmian lub napraw instalacji, bez wcześniejszego porozumienia w tej sprawie z Wykonawcą, która powinna być zawarta pomiędzy Stronami w formie pisemnej przed rozpoczęciem wykonywania zmian lub napraw.W przypadku braku porozumienia wszelkie koszty prac opisanych w zdaniu poprzednim ponosi Zamawiający."
  );
  numberText(
    "Zamawiający wyraża zgodę na korzystanie przez Wykonawcę z podwykonawców."
  );
  numberText(
    "Wykonawca oświadcza, iż jest objęty ubezpieczeniem OC z tytułu prowadzenia działalności gospodarczej na kwotę 5 000 000,00 zł. Wykonawca zobowiązuje się do posiadania ważnego ubezpieczeniem OC, na kwotę nie mniejszą jak w zdaniu pierwszym, przez cały okres realizacji zamówienia, w przypadku wygaśnięcia umowy ubezpieczenia przed końcem realizacji przedmiotu umowy Wykonawca zobowiązuje się do zawarcia nowej umowy ubezpieczenia z zachowaniem ciągłości ubezpieczenia. Ewentualne koszty napraw szkód spowodowanych przez Wykonawcę i przywrócenia stanu pierwotnego miejsca instalacji nieujęte ubezpieczeniem będą określone w oparciu o spisane protokoły, wycenę rynkową i po potwierdzeniu przez obydwie strony w pisemnym porozumieniu, które powinna być zawarta przed realizacją napraw. Wykonawca ma prawo zweryfikować wycenę kosztów przywrócenia do stanu pierwotnego z ekspertem zewnętrznym lub w oparciu o zorganizowane postępowanie wyboru wykonawcy napraw."
  );
  numberText(
    "Część wynagrodzenia należnego Wykonawcy opłacona z Finansowania Zewnętrznego może być uiszczana na rzecz Wykonawcy za pośrednictwem Instytucji Finansującej zgodnie z Umową o Finansowanie."
  );
  numberText(
    "Wykonawca może wstrzymać realizację umowy i zaproponować Zamawiającemu nową cenę w przypadku, gdy średni kurs Euro publikowany przez Narodowy Bank Polski wzrośnie o ponad 0,5 w stosunku do kursu z dnia podpisania niniejszej umowy. Ewentualna zmiana ceny będzie wymagała zawarcia aneksu do niniejszej umowy."
  );

